import logo from './logo.png';
import './App.css';
import Button from '@material-ui/core/Button';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import MenuItem from '@material-ui/core/MenuItem';
import React from 'react';

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: '25ch',
    },
  },
}));

const tripType = [
  {
    value: 'oneWay',
    label: 'One Way'
  },
  {
    value: 'rounded',
    label: 'Round Trip'
  }
];


function App() {
  const classes = useStyles();
  const [currency, setCurrency] = React.useState('oneWay');

  const handleChange = (event) => {
    setCurrency(event.target.value);
  };
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p> Fly At Will </p>




        <form className={classes.root} noValidate autoComplete="off">
          <label><TextField id="outlined-basic" label="Departure" name="depart" variant="outlined" /></label>
          <label><TextField id="outlined-basic" label="Arrival" name="arrival" variant="outlined" /></label>
          <form className={classes.container} noValidate>
                        <TextField
                          id="date"
                          label="Date Outward"
                          type="date"
                          defaultValue="2017-05-24"
                          className={classes.textField}
                          InputLabelProps={{
                            shrink: true,
                          }}
                        />
                      </form>
          <label>Date Inward<input type="date" name="Inward" /></label>
          <TextField name="trip"
            id="standard-select-currency"
            select
            label="Trip Type"
            value={currency}
            onChange={handleChange}
          >
            {tripType.map((option) => (
              <MenuItem key={option.value} value={option.value}>
                {option.label}
              </MenuItem>
            ))}
          </TextField>

          <Button type="submit" variant="contained" color="primary">Submit</Button>
        </form>
      </header>
    </div>
  );
}


export default App;
